import MainContainer from "../../../components/maincontainer/maincontainer";
import SubContainer from "../../../components/subcontainer/subcontainer";
import OutlineButton from "../../../components/outlinebutton/outlinebutton";
import styles from "./test.module.css";
import React, { useState } from "react";
import Header from "../../../components/mainheader/header";
export default function Test() {
  const [score, setScore] = useState(0);
  const [moneyArray, setMoneyArray] = useState([]);

  const handleClickooo = (e) => {
    var Xlocation = e.clientX;
    var Ylocation = e.clientY;
    setScore(score + 1);
    var newElement = (
      <div className={styles.money} style={{ top: Ylocation, left: Xlocation }}>
        ooo
      </div>
    );
    setMoneyArray([...moneyArray, newElement]);
  };

  const handleClickoee = (e) => {
    var Xlocation = e.clientX;
    var Ylocation = e.clientY;
    setScore(score + 1);
    var newElement = (
      <div className={styles.money} style={{ top: Ylocation, left: Xlocation }}>
        oee
      </div>
    );
    setMoneyArray([...moneyArray, newElement]);
  };

  const flush = (e) => {
    var Xlocation = e.clientX;
    var Ylocation = e.clientY;
    setScore(0);
    var newElement = (
      <div className={styles.money} style={{ top: Ylocation, left: Xlocation }}>
        ohyahyah
      </div>
    );
    setMoneyArray([...moneyArray, newElement]);
  };

  return (
    <>
      <div style={{ top: 0, left: 0, position: "absolute" }}>{moneyArray}</div>
      <MainContainer>
        <SubContainer>
          <div className={styles.container2}>
            <Header title="Oee/Ooo Simulator"></Header>
            <div>Score: {score}</div>
            <OutlineButton title="Flush" click={flush}></OutlineButton>
          </div>
          <div className={styles.container}>
            <OutlineButton title="Oee" click={handleClickooo}></OutlineButton>
            <OutlineButton title="Ooo" click={handleClickoee}></OutlineButton>
          </div>
        </SubContainer>
      </MainContainer>
    </>
  );
}
